import "./message.css"

export default function Message({own}) {
  return (
    <div className='message own'>
      <div className="messageTop">
        <img src="/assets/f1.jpg" alt="" className="messageImg" />
        <p className='messageText'>Hello my message   </p>
      </div>
      <div className="messageBottom">
        1 hour ago
      </div>
    </div>
  )
}
